    }else{
        return (
            <div>
            <Router>
                <Routes>
                    <Route exact path='/admin/' 
                        element={
                            <AdminLayout>
                                <Dashboard/>
                            </AdminLayout>
                        }>
                    </Route>
                    <Route path='/admin/add-student' 
                        element={
                            <AdminLayout>
                                <Add/>
                            </AdminLayout>
                        }>
                    </Route>
                    <Route path='/admin/edit-student/:id' 
                        element={
                            <AdminLayout>
                                <Edit/>
                            </AdminLayout>
                        }>
                    </Route>
                </Routes>
            </Router>
            </div>
        )
    }

}
